// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.7.0 <0.9.0;

contract AuctionCreator {
    Auction[] public auctions;

    function createAuction() public {
        Auction newAuction = new Auction(msg.sender);
        auctions.push(newAuction);
    }
}

contract Auction {
    address payable public owner;
    uint256 public startBlock;
    uint256 public endBlock;
    string public ipfsHash;

    enum State {
        Started,
        Running,
        Ended,
        Canceled
    }

    State public auctionState;

    uint256 public highestBindingBid;
    address payable public highestBidder;

    uint256[] public bidsArray;
    mapping(address => uint256) public bids;
    uint256 bidIncrement;

    event AuctionStateChange(State auctionState);
    event BidPlaced(uint value, address _address);

    constructor(address EOA) {
        owner = payable(EOA);
        auctionState = State.Running;
        startBlock = block.number;
        endBlock = startBlock + 3;
        ipfsHash = "";
        bidIncrement = 1000000000000000000;
    }

    modifier onlyOwner() {
        require(msg.sender == owner);
        _;
    }

    modifier notOwner() {
        require(msg.sender != owner);
        _;
    }

    modifier afterStart() {
        require(block.number >= startBlock);
        _;
    }

    modifier beforeEnd() {
        require(block.number <= endBlock);
        _;
    }

    function min(uint256 a, uint256 b) internal pure returns (uint256) {
        if (a <= b) {
            return a;
        } else {
            return b;
        }
    }

    function cancelAuction() public onlyOwner {
        auctionState = State.Canceled;
        emit AuctionStateChange(auctionState);
    }

    function finalizeAuction() public {
        require(auctionState == State.Canceled || block.number > endBlock);
        require(msg.sender == owner || bids[msg.sender] > 0);

        address payable recipient;
        uint256 value;

        if (auctionState == State.Canceled) {
            recipient = payable(msg.sender);
            value = bids[msg.sender];
        } else {
            //ended
            auctionState = State.Ended;
            emit AuctionStateChange(auctionState);
            if (msg.sender == owner) {
                recipient == owner;
                value = highestBindingBid;
            } else {
                if (msg.sender == highestBidder) {
                    //bidder owner
                    recipient = highestBidder;
                    value = bids[highestBidder] - highestBindingBid;
                } else {
                    // other bidders
                    recipient = payable(msg.sender);
                    value = bids[msg.sender];
                }
            }
        }

        bids[recipient] = 0; //reset bids of recipient so next time he calls he won't be a bidder anymore

        recipient.transfer(value);
    }

    function getBids() public view returns (uint256[] memory) {
        return bidsArray;
    }

    function placeBid() public payable notOwner afterStart beforeEnd {
        require(auctionState == State.Running, "Auction not running");
        require(msg.value >= 100, "Value is not enough");

        uint256 currentBid = bids[msg.sender] + msg.value;
        require(currentBid > highestBindingBid, "Bid not enough");

        bids[msg.sender] = currentBid;
        bidsArray.push(currentBid);

        if (currentBid <= bids[highestBidder]) {
            // your own bid
            highestBindingBid = min(
                currentBid + bidIncrement,
                bids[highestBidder]
            );
        } else {
            highestBindingBid = min(
                currentBid,
                bids[highestBidder] + bidIncrement
            );
            highestBidder = payable(msg.sender);
        }

        emit BidPlaced(currentBid, msg.sender);
    }
}
